import React from "react";

const Card = (props) => {
  return (
    <div
      style={{
        //backgroundColor: "purple",
        display: "flex",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          display: "flex",
          backgroundColor: "blue",
          justifyContent: "flex-start",
          width: "80%",
          marginTop: "15px",
          height: "100px",
          borderRadius: "10px",
        }}
      >
        <div
          style={{
            justifyContent: "flex-start",
            display: "flex",
            width: "15%",
            textAlign: "center",
            backgroundColor: "gray",
            borderRadius: "10px 0px 0px 10px",
          }}
        ></div>
      </div>
    </div>
  );
};

export default Card;
